String_MultiLevelGridIndxDescription=A multi-level grid approach is adopted to organize and manage data. The basic method of grid indexing is to divide a dataset into equal or unequal grids according to certain rules, and then record the grid position occupied by each geographical object. \n  When a spatial query begins, the multi-level grid firstly finds the grid in which the query object is located, and then quickly query the selected geographic object. This approach could optimize the query operation.\n   For massive data management. \n  For  entry editor data.\n  For multi-user concurrent scene.
String_TileIndexDescription=Classify the spatial objects according to a certain field in the dataset or a specified range, and then mange the classified objects by index to improve indexing speed. Particularly, the map sheet index could be cached to the local(in the form of binary file) to further improve query speed. Users could set a directory to store the cache file by modifying the FileCacheFolder property in the Environment class. Map sheet indexing suits for massive data(data with more than one million objects).
String_TileIndex_ByBound=\n    The basic principle of creating map library index by range is to improve indexing efficiency by dividing ranges. The length and width for each unit range are one thirtieth of those for the dataset range.
String_TileIndex_ByField=\n    If a dataset contains location related fields such as map sheet number or administrative division code, the map library index could be created according to a field of them. And it is recommended to create a map library index by range if there is no such field.
