String_NoneSpatialIndexDescrition="None" of spatial index indicating no spatial index during the range querying, applicable for low-volume data circumstance.
String_QtreeDescription=Q-tree structure is mainly used to express the spatial hierarchy relation under two-dimensional coordinates. Actually, it is an extension of one-dimensional binary-tree in the two-dimensional space.\n    So, Q-tree index is to divide a map into four equal parts, then subdivide each of the four parts into four equal subparts, and so on. Only if the pixels in any region are not entirely 0s or 1s, it should be subdivided.\n    The management of medium data is very efficient.\n   Not suitable for mass space data management.
String_RtreeDescription=R-tree index is to design some rectangles containing geographically neighboring target objects. Regarded as spatial indexes, these rectangles contain pointers of all spatial objects in them. \n     During a query, an R-tree firstly find all rectangles that are contained within the query window, then further find the targets to be retrieved. The R-Tree method could increase the query speed.\\ n  Suitable for data that is not frequently modified. \\ n  can be used for multi-user concurrent scenes.
String_PGISTtreeDescription=PostgreSQL Spatial Data Extension The GIST index in PostGIS means a generic search tree that is currently only used by the PGGIS engine.\n   The GIST index is a balanced, access to a tree structure.\\ n  Advantages: For multidimensional data types and collection data types, as well as to other data types, and GIST multiple-field indexes use index scans for any subset of the indexed fields in the query criteria.\\ n  Disadvantages: GIST index to create a longer time-consuming, space is also relatively large.
